package my.topcoder;import java.util.*;public class PrefixFreeSets {    public int maxElements(String[] words) {        Arrays.sort(words);        int c = 0;        for (int i = 0; i < words.length; i++) {            String string = words[i];            for (int j = i + 1; j < words.length; j++) {                String word = words[j];                if (word.startsWith(string)) {                    ++c;                    break;                }            }        }        return words.length - c;    }}